import './App.css';
import { Routes, Route, Link } from "react-router-dom";
import About from "./about.js"
import TopCharts from "./chart.js"
import MyList from "./mylist.js"
import MyProfile from "./myprofile.js"
import Settings from "./settings.js"


function Header() {
  return (
      <ul className = "flex list-none	shadow flex justify-center my-0 p-5 mx-auto gap-8">
                  <li><Link to = "/">Top Charts</Link></li>
          <li><Link to="/mylist">My List</Link></li>
          <li><Link to="/myprofile">My Profile</Link></li>
          <li><Link to="/about">About</Link></li>
          <li> <Link to="/settings">Settings</Link></li>
          <li> <input className = "rounded shadow bg-gray-100" type="text"/></li>
      </ul>
  )
}


function App() {
  return (
    <div className="App">
     <Header/>
     <Routes className = "bg-slate-200">
        <Route path="/mylist" element={<MyList/>} />
        <Route path="/myprofile" element={<MyProfile/>} />
        <Route path="/" element={<TopCharts/>} />
        <Route path="/about" element={<About/>} />
        <Route path="/settings" element={<Settings/>} />
      </Routes>
    </div>
  );
}

export default App;
